import './App.css';
import FadeSlider from './components/FadeSlider/FadeSlider';
import Header from './components/Header/Header';
import LazyLoadImage from './components/LazyLoad/LazyLoadImage';


function App() {
  return (
    <>
      <Header />
      <FadeSlider />
      <LazyLoadImage />
    </>
  );
}

export default App;
